INSERT INTO `faq` (`QuestionID`, `EmployeeID`, `Question`, `Answer`, `Edit Date`) VALUES
(6, 13, 'How do I get in touch with my Service Team Representative?', 'You can call us at 248.276.0950. Any member of our Service Team will be able to assist you.', '2019-12-24 21:37:26'),
(7, 13, 'What do I do in the event an employee is injured while on the job, is on restrictions or if I have questions or concerns related to the employee?\r\n', 'Please call us immediately at 248.276.0950. Our Service Team will advise you on the appropriate course of action.', '2019-12-24 21:37:26'),
(8, 13, 'Where can I access important documents related to payroll, benefits, worksite injury, DARWIN, etc?\r\n', 'Client related documents and communications can be accessed via our EO-Info section of the website for Clients. You can access by clicking on Clients within the Login link at the top of the page or by going directly to www.employeesonly.net/clients/\r\n', '2019-12-24 21:37:40'),
(12, 13, 'I have questions, who do I contact?', 'You can call us at 248.276.0950. Any member of our Service Team will be able to assist you. We can answer your questions related to payroll, benefits, work assignment or just about anything else related to be an employee.', '2019-12-25 13:24:54'),
(13, 13, 'Do you provide any online resources to help me with my benefits, payroll, download forms or anything else related to being an employee?', 'Yes we do! Employee related documents and communications can be accessed via our EO-Info section of the website for Employees. You can access by clicking on Employees within the Login link at the top of the page or by going directly to www.employeesonly.net/EO-Info/Employees.\r\n', '2019-12-25 13:24:54'),
(14, 13, 'What kind of benefits are available?', 'Our benefit offerings range from health/dental/vision to investment options such as 401k. We also offer ancillary benefits such as Employee Assistance Programs and pre-paid Legal services. Because we utilize group benefit plans, we are able to obtain the best prices possible in addition to some of the best benefit packages around.\r\n', '2019-12-25 13:25:40');

